const HomePageView = () => {
  return (
    <div>
      <h6>Final Project</h6>
      <Link to={'/instructors'} > All Instructors </Link>
      <Link to={'/courses'} > All Courses </Link>

    </div>
  );    
}




export default HomePageView;
